import React from "react";

interface Props {
  src: string;
  alt: string;
  size: CSS;
}

/**
 *
 * @param src - Fuente de la imagen
 * @param alt - Texto alternativo
 * @param size - Tamaño en formato CSS
 * @returns
 */
export const Image = (props: Props) => {
  return (
    <img
      className="centerImage"
      src={props.src}
      alt={props.alt}
      style={props.size}
    ></img>
  );
};
